import { Container, Row } from 'react-bootstrap'
import "./MainScreen.css"

 const MainScreen = ({title,children,ending}) => {
  return (
    <div className='mainback'>
        <Container>
            <Row>
                <div className='page'>
                    {
                        title && (<>
                            <h1 className='heading'>{title}</h1>
                            <hr />


                        </>)

                    }
                    <br></br>
                    {children}
                     {ending}
                </div> 
            </Row>

        </Container>
        </div>
  )
}
export default MainScreen;
